import React from 'react';
import Button from '@material-ui/core/Button';
import { useRouter } from 'next/router';

export default () => {
  const router = useRouter();

  console.log(router);

  return (
    <div>
      <Button variant="contained" color="primary">
        Hello World
      </Button>
    </div>
  );
};
